import React from 'react';
import './Card.css';

const front = true;

function Flip() {
    front = !front;
};


const Card = (props) => {

    return (
        <div className="card">
            <h3>
                {props.title}
            </h3>

            <button>
                Learn More
            </button>
        </div>
    );
};

export default Card;
